sap.ui.define(['sap/ui/webc/common/thirdparty/base/renderer/LitRenderer'], function (litRender) { 'use strict';

	const block0 = (context, tags, suffix) => litRender.html`<div class="ui5-uc-root" role="region" aria-roledescription="${litRender.ifDefined(context._roleDescription)}" @drop="${context._ondrop}"><div class="${litRender.classMap(context.classes.content)}"><${litRender.scopeTag("ui5-list", tags, suffix)} accessible-name="${litRender.ifDefined(context.accessibleName)}" mode="${litRender.ifDefined(context.mode)}" @ui5-selection-change="${litRender.ifDefined(context._onSelectionChange)}" @ui5-item-delete="${litRender.ifDefined(context._onItemDelete)}"><slot slot="header" name="header"></slot><slot></slot></${litRender.scopeTag("ui5-list", tags, suffix)}>${ context._showNoData ? block1(context, tags, suffix) : undefined }${ context._showDndOverlay ? block2(context, tags, suffix) : undefined }</div></div>`;
	const block1 = (context, tags, suffix) => litRender.html`<div class="${litRender.classMap(context.classes.noFiles)}"><div class="icon-container"><${litRender.scopeTag("ui5-icon", tags, suffix)} name="document"></${litRender.scopeTag("ui5-icon", tags, suffix)}></div><${litRender.scopeTag("ui5-label", tags, suffix)} class="title" wrapping-type="Normal">${litRender.ifDefined(context._noDataText)}</${litRender.scopeTag("ui5-label", tags, suffix)}><${litRender.scopeTag("ui5-label", tags, suffix)} class="subtitle" wrapping-type="Normal">${litRender.ifDefined(context._noDataDescription)}</${litRender.scopeTag("ui5-label", tags, suffix)}></div>`;
	const block2 = (context, tags, suffix) => litRender.html`<div class="${litRender.classMap(context.classes.dndOverlay)}" @dragenter="${context._ondragenter}" @dragleave="${context._ondragleave}" @dragover="${context._ondragover}"><${litRender.scopeTag("ui5-icon", tags, suffix)} name="upload-to-cloud"></${litRender.scopeTag("ui5-icon", tags, suffix)}><span class="dnd-overlay-text">${litRender.ifDefined(context._dndOverlayText)}</span></div>`;

	return block0;

});
